tables.table_schema:
CREATE TABLE assembly_line_metrics (
  line_id INT PRIMARY KEY,
  product_id INT,
  production_rate FLOAT,
  efficiency_score FLOAT
);

CREATE TABLE performance_metrics (
  id INT PRIMARY KEY,
  efficiency DECIMAL,
  production_rate DECIMAL,
  error_rate DECIMAL
);

CREATE TABLE assembly_line_performance (
    id INT PRIMARY KEY,
    assembly_line_id INT,
    production_rate FLOAT,
    efficiency FLOAT
);

CREATE TABLE quality_control (
    id INT PRIMARY KEY,
    assembly_line_id INT,
    defect_type VARCHAR(255),
    defect_count INT
);

CREATE TABLE process_improvement (
    id INT PRIMARY KEY,
    assembly_line_id INT,
    improvement_area VARCHAR(255),
    implementation_date DATE
);

CREATE TABLE assembly_line_performance_metrics (
  line_id INT,
  efficiency DECIMAL,
  productivity DECIMAL,
  quality_score INT
);

CREATE TABLE defect_tracking (
  defect_id INT,
  line_id INT,
  defect_description TEXT,
  detection_timestamp TIMESTAMP
);
